import{S as a}from"./chunks/Swagger.CHO3_avl.js";import{c as e,J as r,a4 as o,o as s}from"./chunks/framework.DloxLV0O.js";const d=o('<h1 id="arrendadores-api" tabindex="-1">Arrendadores API <a class="header-anchor" href="#arrendadores-api" aria-label="Permalink to &quot;Arrendadores API&quot;">​</a></h1><h2 id="introduccion" tabindex="-1">Introducción <a class="header-anchor" href="#introduccion" aria-label="Permalink to &quot;Introducción&quot;">​</a></h2><p>Bienvenido a la documentación de la API de Arrendadores, una interfaz de programación de aplicaciones diseñada para facilitar la gestión eficiente de arrendadores y sus propiedades. Esta API proporciona un conjunto robusto de herramientas para crear, consultar, actualizar y eliminar información relacionada con arrendadores, así como gestionar las propiedades asociadas a cada uno de ellos.</p><h3 id="caracteristicas-principales" tabindex="-1">Características Principales <a class="header-anchor" href="#caracteristicas-principales" aria-label="Permalink to &quot;Características Principales&quot;">​</a></h3><ul><li><strong>Gestión de Arrendadores</strong>: Crea, consulta, actualiza y elimina arrendadores en tu sistema, permitiendo un manejo detallado de su información.</li><li><strong>Administración de Propiedades</strong>: Asocia propiedades a arrendadores, actualiza detalles de estas propiedades y gestiona su relación de manera eficiente.</li><li><strong>Búsqueda Avanzada</strong>: Encuentra arrendadores y propiedades mediante criterios específicos, facilitando la búsqueda por nombre, ubicación, y más.</li><li><strong>Seguridad y Control de Acceso</strong>: Define y controla el acceso a la información de manera segura, asegurando que solo los usuarios autorizados puedan gestionar los datos.</li></ul><h3 id="empezando" tabindex="-1">Empezando <a class="header-anchor" href="#empezando" aria-label="Permalink to &quot;Empezando&quot;">​</a></h3><p>Para comenzar a utilizar la API de Arrendadores, nnecesitarás obtener un token de usuario valido a través de nuestro proceso de login <a href="/docs/developer/autenticacion.html#introduccion">Autenticacion</a>. Nuestra API utiliza tokens de acceso para asegurar las comunicaciones y proteger los datos de nuestros usuarios.</p><p>Una vez autenticado, podrás realizar llamadas HTTP a los endpoints proporcionados, utilizando los métodos <code>GET</code>, <code>POST</code>, <code>PUT</code>, y <code>DELETE</code> para interactuar con la API según tus necesidades.</p><p>Para obtener más detalles sobre los endpoints específicos y cómo utilizarlos, por favor consulta las secciones siguientes de esta documentación.</p><h2 id="arrendadores" tabindex="-1">Arrendadores <a class="header-anchor" href="#arrendadores" aria-label="Permalink to &quot;Arrendadores&quot;">​</a></h2><p>Aquí puedes profundizar en los detalles específicos relacionados con la gestión de arrendadores, incluyendo ejemplos de solicitudes y respuestas para cada operación disponible.</p>',11),p=JSON.parse('{"title":"Arrendadores API","description":"","frontmatter":{},"headers":[],"relativePath":"developer/arrendadores.md","filePath":"developer/arrendadores.md"}'),n={name:"developer/arrendadores.md"},m=Object.assign(n,{setup(i){return(t,c)=>(s(),e("div",null,[d,r(a,{id:"dialersSwagger",yaml:"/docs/specs/arrendadores/arrendadores.yaml"})]))}});export{p as __pageData,m as default};
